import React, { Component } from 'react';
import { Redirect,NavLink } from 'react-router-dom';
import {history} from './../store/helpers/history';
import swal from "sweetalert";
import $ from "jquery";

class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoggedIn: false,
        }
    }
    componentDidMount() {
        $( document ).ready(function() {
            //$('#call-dailer').modal();
            });
            $(".num").click(function () {
                var number = $(this).data('number');
                $("#phoneNumber").val(function() {
                    return this.value + number;
                });
            });
    
        setTimeout(() => { localStorage.removeItem('alert') }, 10000);
    }
    // loadCredentials=()=> {
    //     txtDisplayName = "tauseef.ashher@capanicus.com";
    //     txtPrivateIdentity = "tauseef.ashher@capanicus.com"
    //     txtPublicIdentity = "sip:athos63858@sip.telnyx.com";
    //     txtPassword = "1111111";
    //     txtRealm = 'sip.telnyx.com'; // mandatory: domain name
    //     };

    componentWillMount() {
        
         if (localStorage.getItem('token')) {
            this.setState({ isLoggedIn: true });
        }
    }
    clearNumber =()=>{
        $('#phoneNumber').val('');

    }
    logOut=()=>{
        document.logoutForm.submit(); 
     }
    getDynaminTitle = () => {
        const activeUrl = window.location.pathname;
        if (activeUrl === '/user') {
            return "User";
        } else if (activeUrl === '/product') {
            return "Products";
        } else if (activeUrl === '/category') {
            return "Category";
        } else if (activeUrl === '/sub-category') {
            return "Sub Category";
        } else if (activeUrl === '/slider-images') {
            return "Slider Images";
        } else if (activeUrl === '/rates') {
            return "Rates";
        } else if (activeUrl === '/orders') {
            return "Orders";
        } else if (activeUrl === '/payments') {
            return "Payments";
        }
    };

    logout = () => {
        localStorage.clear('token');
        this.setState({ isLoggedIn: !this.state.isLoggedIn, });
    };

    render() {
        const activeUrl = history.location.pathname
        return (
            <>
            <header id="header">
                {
                    (!this.state.isLoggedIn) &&
                    <Redirect to="/" />
                }
                <div className="navbar-header">
                    <button type="button" className="navbar-toggle collapsed" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1" aria-expanded="false"> <span className="sr-only">Toggle navigation</span> <span className="icon-bar"></span> <span className="icon-bar"></span> <span className="icon-bar"></span> </button>
                    <a href="#" className="navbar-brand"><img src="/assets/img/logo_inner.png" /></a>
                    <a data-toggle="collapse" href="#aside" className="visible-xs pull-left" aria-expanded="false" aria-controls="collapseExample"><i className="fa fa-indent"></i></a>
                </div>
                <nav className="navbar navbar-default">
                    <div className="collapse navbar-collapse" id="bs-example-navbar-collapse-1">

                        <ul className="nav navbar-nav navbar-right">
                            <li><a href="#" className="dialer-icon" data-toggle="modal" data-target="#call-dailer"><i className="icon-phone icons"></i></a></li>
                            <li className={activeUrl === '/transactions' ? 'active':''} ><NavLink to="/transactions"><i className="icon-disc icons"></i><span>Transactions</span></NavLink></li>
                            <li className={activeUrl === '/reports' ? 'active':''} ><NavLink to="/reports"><i className="icon-docs icons"></i><span>Reports</span></NavLink></li>
                            <li className={activeUrl === '/live-calls' ? 'active':''} ><NavLink to="/live-calls"><i className="icon-docs icons"></i><span>Live Calls</span></NavLink></li>
                            <li className={activeUrl === '/support/all' ? 'active':''} ><NavLink to="/support/all"><i className="icon-support icons"></i><span>Support</span></NavLink></li>
                            <li className="dropdown profile-drop"> <a href="#" className="dropdown-toggle" data-toggle="dropdown" role="button" aria-haspopup="true" aria-expanded="false"><img src="/assets/img/profile_icon_2.png" alt="profile" /></a>
                                <ul className="dropdown-menu">
                                    <li><a href="#">My Profile</a></li>
                                    <li><a href="#">Plans</a></li>
                                    <li><a href="#">Setting</a></li>
                                    <li><a href="javascript:void(0)" onClick={()=>this.logout()} >Logout</a></li>
                                </ul>
                            </li>

                        </ul>
                    </div>
                </nav>
            </header>
            <div className="modal dailer-modal fade" id="call-dailer" tabIndex="-1" role="dialog"
        aria-labelledby="exampleModalLabel" aria-hidden="true" data-backdrop="static" data-keyboard="false">
        <div className="modal-dialog modal-md" role="document">
            <div className="modal-content">

                <div className="modal-header">
                    <h5 className="modal-title" id="exampleModalLabel">
                        <button type="button" className="close pull-right" data-dismiss="modal" aria-label="Close"> <span
                                aria-hidden="true">&times;</span> </button>
                    </h5>
                </div>
                                    {/* <div  ><input type="button" className="btn btn-sm btn-success" id="btnRegister" value="LogIn" disabled onClick={()=>window.sipRegister()}/></div>
                                    
                                    <div ><input type="button" className="btn btn-sm btn-danger" id="btnUnRegister" value="LogOut" disabled onClick={()=>window.sipUnRegister()} /></div> */}
                <div className="modal-body text-center">
                    <div className="dialer-body">
                        <div className="status">
                         <p  id="txtCallStatus"></p> 
                        </div>
                        <div className="dial-number">
                        <p className="text-left">
                            <span className="text-left">
                                <input className="form-control dial-input" id="phoneNumber" type="text"/>
                                </span><i className="text-right"><img src="assets/img/clear.png" alt="img" className="clear-number" onClick={()=>this.clearNumber()}/></i></p>
                        </div>
                         <div className="dial-screen-tab" id='divCallOptions'>
                             <a  type="button" className="btn btn-success" id="btnMute" value="Mute" onClick={()=>window.sipToggleMute()} ></a>
                             <a  type="button" className="btn btn-success" id="btnHoldResume" value="Hold" onClick={()=>window.sipToggleHoldResume()} />

                          <a className="tab-com btn" href="#">Transfer </a>
                           <a className="tab-com btn" href="#">Conference </a>

                        </div>
                        <div className="row">
                            <div className="col-md-12 phone">
                                <div className="row1">
                                    <div className="col-md-12" id="divCallCtrl">
                                    <div className="num-pad" id="showScreenDialer">
                                            <div className="span4">
                                                <div className="num" data-number="1">
                                                    <div className="txt">1</div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="2">
                                                    <div className="txt">2 <span className="small">
                                                            <p>
                                                                ABC</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="3">
                                                    <div className="txt">
                                                        3 <span className="small">
                                                            <p>
                                                                DEF</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="4">
                                                    <div className="txt">
                                                        4 <span className="small">
                                                            <p>
                                                                GHI</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="5">
                                                    <div className="txt">
                                                        5 <span className="small">
                                                            <p>
                                                                JKL</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num"  data-number="6">
                                                    <div className="txt">
                                                        6 <span className="small">
                                                            <p>
                                                                MNO</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="7">
                                                    <div className="txt">
                                                        7 <span className="small">
                                                            <p>
                                                                PQRS</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="8">
                                                    <div className="txt">
                                                        8 <span className="small">
                                                            <p>
                                                                TUV</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="9">
                                                    <div className="txt">
                                                        9 <span className="small">
                                                            <p>
                                                                WXYZ</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num">
                                                    <div className="txt star-key">
                                                        *
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num" data-number="0">
                                                    <div className="txt">
                                                        0 <span className="small">
                                                            <p>
                                                                +</p>
                                                        </span>
                                                    </div>
                                                </div>
                                            </div>
                                            <div className="span4">
                                                <div className="num">
                                                    <div className="txt has-key">
                                                        #
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                        <div className="clearfix"></div>
                                        <div className="clearfix"></div>
                                         <div id="callButton">
                                        <a href="javascript:void(0)" id="btnCall" onClick={()=>window.sipCall1('call-audio')}><i className="icon-phone icons"></i></a>
                                        </div>
                                         <div id="cancelCallButton">
                                         <a href="javascript:void(0)" id="btnHangUp" onClick={()=>window.sipHangUp()}><i className="icon-phone icons"></i></a>
                                         </div>
                                    

                                    </div>
                                </div>
                                <div className="clearfix">
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div></div>
            </>
        );
    }
}

export default Header;
